css:
.github-DialogPrompt {
  margin: 1rem;
  text-align: center;
  font-size: 1.2em;
}
.github-DialogInputs {
  display: flex;
  flex-direction: column;
  padding: 0.5rem;
}
.github-DialogLabel {
  flex: 1;
  margin: 0.5rem;
  position: relative;
  line-height: 2;
}
.github-DialogLabelButton {
  position: absolute;
  background: transparent;
  right: .3em;
  bottom: 0;
  border: none;
  color: #798c9d;
  cursor: pointer;
}
.github-DialogLabelButton:hover {
  color: #d3dce4;
}
.github-DialogButtons {
  display: flex;
  align-items: center;
  justify-content: flex-end;
  padding: 0.5rem;
}
.platform-win32 .github-DialogButtons {
  flex-direction: row-reverse;
  justify-content: flex-start;
}
.github-DialogButtons .btn {
  margin: 0.5rem;
}
.github-DialogButtons-leftItem,
.github-DialogButtons-leftItem.btn {
  margin: 0.5rem;
  margin-right: auto;
}
.github-DialogSpinner {
  display: flex;
  align-items: center;
  justify-content: center;
  padding: 1rem;
}
.github-DialogSpinner .loading {
  margin: 1rem;
}
.github-Dialog atom-text-editor[mini].editor {
  margin: 0;
}
